INSERT INTO `ms_novel` VALUES (1,'民间笑话荟萃','&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;1。&lt;a href=&quot;http://www.duwenzhang.com/huati/laogong/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;老公&lt;/a&gt;发工资了，拿回家准备讨好&lt;a href=&quot;http://www.duwenzhang.com/huati/laopo/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;老婆&lt;/a&gt;。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　就对他的老婆说：“亲爱的，我发工资了。亲我一下钱归你了。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　老婆迟迟无动于衷。老公见老婆没有反应。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　又喊了一句：“你要是再不来我就去找人伺候我了，把钱都给她了。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　老婆淡淡地回了一句：“你要是敢去，这些钱你是怎么花的，我就怎么赚回来。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　2。&lt;a href=&quot;http://www.duwenzhang.com/huati/laopo/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;妻子&lt;/a&gt;突然问&lt;a href=&quot;http://www.duwenzhang.com/huati/laogong/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;丈夫&lt;/a&gt;：“你爱我吗？” “爱，当然爱！”丈夫毫不犹豫地回答。 妻子想了想又问：“你是不是怕&lt;a href=&quot;http://www.duwenzhang.com/huati/shanghai/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;伤害&lt;/a&gt;我才说的？” 丈夫连忙说：“不，不，我是怕你伤害我才说的。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　3。小明数学不好被&lt;a href=&quot;http://www.duwenzhang.com/huati/fumu/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;父母&lt;/a&gt;转学到一间教会学校。半年后数学成绩全A。&lt;a href=&quot;http://www.duwenzhang.com/huati/muqin/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;妈妈&lt;/a&gt;问：“是修女教得好？是教材好？是祷告？……”“都不是，”小明说，“进学校的第一天，我看见一个人被钉死在加号上面，我就知道……他们是玩真的。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　4。在公厕里，忽然听到厕间有人说话：“哥们儿，有手纸吗？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　我翻了翻口袋：“抱歉，没有。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　过了几秒钟，那人又问：“那有小块报纸吗？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　我&lt;a href=&quot;http://www.duwenzhang.com/huati/wunai/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;无奈&lt;/a&gt;地一笑：“对不起，没有，我只是来小便的。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　又过了几秒钟，厕间门缝塞出一张10元人民币：“能帮我换成10张1块的吗？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　我把钱递过去，厕间里传来一声咆哮：“你别给我十个硬币啊！”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　5。 20年前&lt;a href=&quot;http://www.duwenzhang.com/huati/fuqin/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;爸爸&lt;/a&gt;抱着你等车，人都笑话&lt;a href=&quot;http://www.duwenzhang.com/huati/haizi/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;孩子&lt;/a&gt;长得难看，爸爸哭了。一卖香蕉的老大爷拍拍爸爸说：“大&lt;a href=&quot;http://www.duwenzhang.com/huati/xiongdi/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;兄弟&lt;/a&gt;别哭了，拿只香蕉给猴子吃吧！真可怜，饿的都没毛了。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　6。 话说某位女士一时兴起，买了一只母鹦鹉。没想到带回家里，它说的第一句话就是：“想跟我上床吗？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　女士一听，心想：坏了，外人还以为这话是我教的呢， 这不把我的淑女形象全给毁了。于是她想尽办法，想交那只鹦鹉说些高雅的东西，可是那只母鹦鹉算是铁了心了，只会说一句话：“想跟我上床吗？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　……怎么办呢？在那位女士&lt;a href=&quot;http://www.duwenzhang.com/huati/shiqu/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;失去&lt;/a&gt;主张的时候，听说神父那儿也养了一只鹦鹉（公的），而且那只鹦鹉，不但不讲粗话，反而是个虔诚的教徒，每天大部分&lt;a href=&quot;http://www.duwenzhang.com/huati/shijian/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;时间&lt;/a&gt;里都在祷告。于是那位女士去找神父求助。神父明白她的来意之后，面色微难的说：“这个，很难办呀，其实那只鹦鹉，也并没有刻意的教它什么，它之所以这么虔诚，也可能是长期在此受熏陶的缘故吧。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　神父见女士很失落，便说道：“这样吧，你把那只鹦鹉带到我这里来，我把它们放在一起。&lt;a href=&quot;http://www.duwenzhang.com/huati/xiwang/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;希望&lt;/a&gt;经过一段时间，你那只鹦鹉能够被感化。我只能做这些了，有没有效果，就看神的旨意了……”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　女士一听，也只能这样了，不是有句话叫：近朱者赤吗？试试吧。于是她把鹦鹉带到神父那里。神父依照诺言把两只鹦鹉放在了一起。开始母鹦鹉还有些拘谨，看那只公鹦鹉在笼子的一角，默默的祷告，还真不忍心打扰。可是她还是管不住自己，终于朗声说道：“想跟我上床吗？“&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　公鹦鹉听到这话，停止了祷告，转身看了看母鹦鹉，忽然泪如雨下：“感谢上帝，我祷告这么多年的&lt;a href=&quot;http://www.duwenzhang.com/huati/yuanwang/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;愿望&lt;/a&gt;终于实现了……”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　7。青年跋涉深山，历经险阻，终于找到了隐居山中的禅师，他迫不及待地问道：“我长得丑，我该怎么办？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　“长得丑就应该像我一样。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　青年点点头：“心如止水，独善其身？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　“不，长得丑就要像我一样赶紧找个深山躲起来。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　8。本人女，以前一百四十多斤，现在瘦下来了。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　某日准备出门找不到电话了，于是拿老爸电话打我电话，打过去老爸电话上华丽丽地显示了“大肥猪”三个字。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　9。突然停电了，“大热的天，还让不让人活了，真烦人。”我抱怨道。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　儿子却在一旁笑呵呵地说：“我觉得停电也挺好的。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　听他这么说，就更加来气了：“大热天的，停电有啥好处啊？就知道瞎说！”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　儿子被我训得低下头，小声嘟囔道：“停电我就不用做作业了呗……”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　10。 渔夫晚上捕鱼回来，看见儿子正与邻居家的姑娘披着渔网在亲热，渔夫怒问：你们这是干嘛？&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　儿笑笑，说：老爸，你不懂，我们这叫网恋！&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　11。一次学校让买学习资料，大家都是7块钱，我为了让自己能有点零用钱花一张嘴就要了10块，结果老妈不信我，就跑去问家对面的同班同学，当时那心里忐忑的差点就说实话了。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　没想到老妈一回来就说：“一看上课就没听&lt;a href=&quot;http://www.duwenzhang.com/huati/laoshi/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;老师&lt;/a&gt;讲课，人家明明是12块！”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　12。 地铁人满为患，可那些&lt;a href=&quot;http://www.duwenzhang.com/huati/nvhai/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;女孩&lt;/a&gt;宁愿站着也不愿意坐我身边的空位。直到我到站了也没人来坐。“难道因为我的帅让她们小鹿乱撞了而不敢靠近我？下次是不是应该戴个口罩出门？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　我一边把袜子穿好准备下车一边反思。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　13。 经过不懈&lt;a href=&quot;http://www.duwenzhang.com/huati/nuli/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;努力&lt;/a&gt;，我戒掉了睡前玩手机的&lt;a href=&quot;http://www.duwenzhang.com/huati/xiguan/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;习惯&lt;/a&gt;，但不知道能坚持多久，总不能一辈子不睡觉吧！&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　14。　——研表究明，汉字的序顺并不定一能影阅响读，比如当你看完这句话后，才发这现里的字全是都乱的。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　15。 一天傍晚在小河边，阿Q对他的的新交&lt;a href=&quot;http://www.duwenzhang.com/huati/nvpengyou/index1.html&quot; target=&quot;_blank&quot; style=&quot;color: rgb(51, 51, 51); text-decoration-line: none;&quot;&gt;女朋友&lt;/a&gt;说：我可以讲一个字让你笑。女友说不信。阿Q这时，走到了一只哈八狗面前，扑通一声跪地上，只听一声大喊：爹。结果引来了所有闻言者的哄堂大笑。阿Q回过头来对女友又喊了一句：妈。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　16。 一位男子跑进车厢，着急地嚷嚷：“隔壁车厢里有一位太太晕过去了，谁带了威士忌？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　乘客中很快有人拿出了威士忌。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　这位男子接过。喝了几大口，然后将酒瓶还给乘客道：“太谢谢你了，我这人看见女士晕倒就难受，这下好多了。”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　17。 第一天，小白兔去河边钓鱼，什么也没钓到，回家了。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　第二天，小白兔又去河边钓鱼，还是什么也没钓到，回家了。&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　第三天，小白兔刚到河边，一条大鱼从河里跳出来，冲着小白兔大叫：&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　你他妈的要是再敢用胡箩卜当鱼饵，我就扁死你！&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　18。 顾客：“你们卖的酒怎么没有酒味啊？”&lt;/p&gt;&lt;p style=&quot;font-family: &amp;quot;Microsoft YaHei&amp;quot;; font-size: 14px; white-space: normal;&quot;&gt;　　服务员接过一闻：“啊，真对不起，忘记给您掺酒了。”&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','','','http://ms.tp9gp9.cn/XResource/20190116/M7XFPzHhbFeCZznsz5He3YeS3ACZhAXZ.jpg',1547612262,1,1547612262,3,0,0,'8','16',0,1,'');
/*!40000 ALTER TABLE `ms_novel` ENABLE KEYS */;
UNLOCK TABLES;

